def decode(encoded):
    decoded = []
    for entry in encoded:
        parts = entry.split("#")
        decoded.append({
            "latin": parts[0],
            "english": parts[1].split(", "),
            "pos": parts[2],
            "stages": [int(x) for x in parts[3].split(",")],
            "unknown": int(parts[4])
        })
    return decoded

decoded = decode(encoded)
fullList = []
stages = []

for i in range(41):
    stages.append([]);

for entry in decoded:
    if (entry["stages"][0] == 0):
        continue
    fullList.append([
        entry["latin"].split(", ")[0],
        entry["latin"],
        entry["pos"],
        entry["english"]
    ])
    for stage in entry["stages"]:
        stages[stage].append(len(fullList))

stages[0] = []

for entry in fullList:
    print(str(entry) + ",")

for entry in stages:
    print(str(entry) + ",")